  const [data, setData] = useState({ username: "", password: "" });

  const register = async () => {
    await axios.post("http://localhost:3000/auth/register", data);
    alert("Usuario registrado");
  };

  return (
    <>
      <h2>Registro</h2>
      <input
        placeholder="Usuario"
